import React from 'react'

const Bidding = ({ product_id }) => {
  // Assuming 'product_id' is an array of objects with bid details
  // For example: [{ bidder: 'User1', amount: 100, date: '2023-01-01' }, ...]


  return (
    <div className="product_id-table">
      <h2>product_id</h2>
      <table>
        <thead>
          <tr>
            <th>Bidder</th>
            <th>Amount</th>
            <th>Date</th>
          </tr>
        </thead>
        <tbody>
          {product_id && product_id.length > 0 ? (
            product_id.map((bid, index) => (
              <tr key={index}>
                <td>{bid.bidder}</td>
                <td>${bid.amount}</td>
                <td>{bid.date}</td>
              </tr>
            ))
          ) : (
            <tr>
              <td colSpan="3">No product_id yet</td>
            </tr>
          )}
        </tbody>
      </table>
    </div>
  );
};

export default Bidding;
